abstract:
Located in London, the World Heritage listed Royal Botanic Gardens Kew is a scientific institution responsible for the largest plant and fungal collections on Earth. For 250 years, its focus has been on documenting plant diversity and economic botany, increasingly emphasising plant conservation in modern decades. RBG Kew played a key role in early European exploration of plant life, and in the establishment of major crops including tea, coffee, rubber and quinine. Kew's Millennium Seed Bank Project was successful in securing seed of 10% of wild plant species in seed banks in 54 countries of origin by 2010, backed up by the MSB collection in Kew's annexe garden at Wakehurst Place, Sussex. Kew's Breathing Planet Program, instituted in 2009, is focused on seven strategies to inspire and deliver science-based plant conservation worldwide, enhancing the quality of life. RBG Kew exemplifies institutional persistence through times of both patronage and austerity. 



Key Concepts 

A botanic garden contains scientifically named collections of plants, living and preserved, for public study, enjoyment, education, conservation and use. 
A herbarium is a plant museum of dried labelled specimens for taxonomic, ecological, conservation and geographic studies. 
Taxonomy/systematics is the science of plant naming and classification. 
Economic botany is concerned with useful plants involved in human commerce. 
Molecular phylogenetics is the science of evolutionary relationships using DNA sequence data. 
Restoration ecology aims to repair and remediate damaged natural habitats, primarily through plant cultivation and management. 
A seed bank stores plant materials under cool temperature and low humidity for future study, conservation and use. 




